import React, { Component } from 'react'

export default class Essays extends Component {
  render(){
    return(
      <div className = "container placement">
        <div className="tile">
          <h3>Title</h3>
            <h5>Subtitle</h5>
            <h5>Date - Date</h5>
            <img src = { image } className = "projectImage" />
            <p>Short description</p>
        </div>
      </div>
    )
  }
}
